import React from 'react';
import PropTypes from "prop-types";
import { withStyles } from "@material-ui/core/styles";

import { connect } from 'react-redux'
import {Switch, Route, withRouter,Redirect} from 'react-router-dom';

// ACTIONS
import {removeError} from '../store/actions/errors'
import { authUser } from '../store/actions/auth';

// COMPONENTS
// import Homepage from '../components/Homepage';
import HomeMain from './Home/HomeMain';
import PatientsMain from "./Patients/PatientsMain";
import ScheduleMain from "./Schedule/ScheduleMain";
import NoMatch from '../components/NoMatch';

//Para que todas las Routes entren en el grid.
const styles = theme => {
  console.log(theme);
  return (
    {
      toolbar: {
          display: "flex",
          alignItems: "center",
          justifyContent: "flex-middle",
          padding: "0 8px",
        },
        content: {
          flexGrow: 1,
          padding: theme.spacing.unit * 10
        },
  })
}  

const Dashboard = props => {
  const { classes, theme } = props;
  const { authUser, errors, removeError, currentUser } = props;
  console.log(currentUser);
  return (
      <main className={classes.content}>
        <div className={classes.toolbar}/>
        <Switch>
          <Route 
            exact 
            path="/" 
            render={props => {
              return (
                <Redirect to='/inicio'/> 
              );
            }}
          />
          <Route 
            exact 
            path="/inicio" 
            render={props => {
              return (
                <HomeMain headerTitle={"Inicio"} />
              );
            }}
          />
          <Route 
            exact 
            path="/pacientes" 
            render={props => {
              return(
                <PatientsMain headerTitle={"Pacientes"}  />
              );
            }}
          />
          <Route 
            exact 
            path="/agenda" 
            render={props => {
              return(
                <ScheduleMain headerTitle={"Agenda"}/>
              );
            }}
          />
          <Route 
            exact 
            path="/dietas" 
            render={props => {
              return(
                <div>Planes alimenticios</div>
              );
            }}
          />
          <Route 
            exact 
            path="/recetas" 
            render={props => {
              return(
                <div>Recetas</div>
              );
            }}
          />
          <Route 
            exact 
            path="/estadisticas" 
            render={props => {
              return(
                <div>Estadísticas</div>
              );
            }}
          />
          <Route component={NoMatch} />
        </Switch>
      </main>

    )
}

function mapStateToProps(state) {
  return {
    currentUser: state.currentUser,
    errors: state.errors
  }
}

Dashboard.propTypes = {
  classes: PropTypes.object.isRequired,
  theme: PropTypes.object.isRequired
};

export default withRouter(connect(mapStateToProps,{ authUser, removeError })(withStyles(styles, {withTheme: true})(Dashboard)))
